import React from "react";
import {Navigate} from "react-router-dom";

export const Navbar = () => {
  return (
    <div>
      <nav className="nav">
        <a> Homepage </a>
        <ul>
        <Link to="/">Home</Link>
      <span></span>
      <Link to="/login">Logout</Link>
        </ul>
      </nav>
    </div>
  );
};
